.contacts {
  background-color: $c-black;
  border-radius: 30px 30px 0 0;
  padding: 72px 0 85px;

  @include onTablet {
    padding: 180px 0 140px;
  }

  @include onDesktop {
    padding-bottom: 0;
  }

  &__container {

    @include onDesktop {
      display: grid;
      grid-template-columns: repeat(12, 1fr);
      column-gap: 24px;
    }
  }

  &__send-message {
    margin-bottom: 80px;

    @include onTablet {
      margin-bottom: 120px;
    }

    &--grid {
      @include onDesktop {
        grid-column: 1 / 6;
      }
    }
  }

  &__title {
    margin: 0 0 48px;

    font-family: inherit;
    font-weight: 600;
    font-size: 32px;
    line-height: 150%;

    color: $c-white;

    @include onTablet {
      margin-bottom: 56px;
    }
  }

  &__contact-us {

    &--grid {
      @include onDesktop {
        grid-column: 7 / 12;

      }
    }

  }

  &__info {
    margin-bottom: 40px;

    @include onTablet {
      margin-bottom: 48px;
    }

    &:last-child {
      margin-bottom: 0;
    }

    &--images {
      display: flex;
      flex-direction: column;
    }
  }

  &__info-title {
    margin-bottom: 8px;
    font-style: normal;
    font-weight: 700;
    font-size: 13px;
    line-height: 20px;

    letter-spacing: 3px;
    text-transform: uppercase;

    color: $c-white;

    opacity: 0.5;

    &--images {
      margin-bottom: 20px;
    }
  }

  &__info-link {
    font-family: $font;
    font-style: normal;
    font-weight: 600;
    font-size: 24px;
    line-height: 150%;
    text-decoration: none;
    transition: $anim;


    color: $c-white;

    &:hover {
      color: $c-blue;
    }

    &--images {
      display: flex;
      gap: 40px;

    }
  }

  &__info-image {
    display: block;
    width: 32px;
    height: 32px;

    background-repeat: no-repeat;
    background-position: center;
    transition: $anim;

    &--inst {
      background-image: url(../images/socials-images/soc1.svg);

      &:hover {
        background-image: url(../images/socials-images/soc1blue.svg);
      }
    }

    &--face {

      background-image: url(../images/socials-images/soc2.svg);

      &:hover {
        background-image: url(../images/socials-images/soc2blue.svg);
      }
    }

    &--twit {

      background-image: url(../images/socials-images/soc3.svg);

      &:hover {
        background-image: url(../images/socials-images/soc3blue.svg);
      }
    }

  }

  &__button {
    background-color: #144ed4;
  }

}

